import React from "react";

function Ticket() {
    return (
        <div className="w-full text-black mt-16 pb-8">
            <div className="max-w-sm bg-red-500 mx-auto ">
                <h1>Congratulations {Name} you have successfully booked a ticket!</h1>
            </div>
        </div>
    )
}

export default Ticket
